import { Label, TextInput } from 'flowbite-react';
import React from 'react';

const StepFour = ({ user }) => {
    return (
        <>
            <h3 className="mb-5 text-xl font-medium text-gray-900 dark:text-white">Oupia đã gửi mã xác nhận đến <span className="text-blueTemplate font-bold">{user.email}</span>, nhập mã OTP</h3>
            <div className="mt-3">
                <TextInput id="OTP" required shadow type="number"/>
            </div>
        </>
    );
};

export default StepFour;
